trailingComments.value:
*
 * 获取当前正在阅读的章节顺序号
 * 安卓处理有别，getClientProgress获取阅读进度，得到的是章节id，需要再通过id取索引
 * ! ios新版旧版桥都调通了，android提示api unavailable
 *
 * @param {string} params.bookId
 * @returns {Promise<*>}
 *
 * @example
 * lib.exec('get-cover-book-current-chapter-index', {
 *   params: {
 *     bookId: 1,
 *   },
 * }).then((info) => {
 *   alert(`[get-cover-book-current-chapter-index][then] ${JSON.stringify(info, null, 2)}`);
 * }).catch((err) => {
 *   alert(`[get-cover-book-current-chapter-index][error] ${JSON.stringify(err, null, 2)}`);
 * });

